INSERT INTO `comments` VALUES (1,NULL,31,1,'This is awesome!','2013-07-10 11:39:17','2013-07-10 11:39:17',0),(2,NULL,32,6,'For best quality print at a 75 Feedrate.','2013-07-10 12:32:45','2013-07-10 12:32:45',0),(3,NULL,31,24,' ','2013-07-12 09:58:20','2013-07-12 09:58:20',1),(4,NULL,33,14,'This is beautiful. I can\'t wait to print it!','2013-07-12 10:01:08','2013-07-12 10:01:08',0),(5,NULL,31,14,'I have GOT to get me one of these!','2013-07-12 10:01:27','2013-07-12 10:01:27',0),(6,NULL,33,14,'This is beautiful. I can\'t wait to print it!','2013-07-12 10:01:33','2013-07-12 10:01:33',0),(7,NULL,37,48,'I am so deleting this','2013-08-14 14:34:09','2013-08-14 14:34:09',0),(8,NULL,37,48,'I am so deleting this','2013-08-14 14:34:45','2013-08-14 14:34:45',1),(9,NULL,36,60,'Spook up your space with a little Halloween jack-o-lantern. ','2013-10-29 11:38:03','2013-10-29 11:38:03',0),(10,NULL,39,61,'just testing and upload','2013-11-17 12:25:42','2013-11-17 12:25:42',0),(11,NULL,44,43,'Needed one of these! Sweet, great upload.','2013-11-24 15:35:14','2013-11-24 15:35:14',0),(12,NULL,39,66,'Just a 3D name plate for your favorite wizard.\r\n','2013-12-05 19:11:57','2013-12-05 19:11:57',0),(13,NULL,49,67,'Servo Arm for Hitech HS-55 Micro servo','2013-12-17 15:02:58','2013-12-17 15:02:58',0),(14,NULL,39,69,'very nice!\r\n','2013-12-18 16:30:10','2013-12-18 16:30:10',0),(15,NULL,39,72,'nice ornament :)\r\n','2013-12-21 20:42:46','2013-12-21 20:42:46',0),(16,NULL,39,77,'Instructions\r\n\r\nASSEMBLY: \r\nPrint one each of both parts.\r\n\r\nCarefully press the 8 mm diameter magnets all the way into the four holes on the back of the indicator bracket. The magnets will sit below the surface so the four motor extruder bolt heads are captured.\r\n\r\nGlue the two parts together using acetone (nail polish remover) as follows:\r\n\r\nAttach the \"indicator_bkt_131217a_holder.stl\" to the \"indicator_bkt_131217a.stl\" with the slot facing the indicator bracket.\r\n\r\nCarefully align the bottom of both parts while gluing.\r\n\r\nUSAGE:\r\n\r\nLower the Z stage (away from the extruder) to provide clearance for the indicator. Center the extruder.\r\n\r\nInstall the indicator gage in the bracket.\r\n\r\nThe assembly will now magnetically snap onto the four motor bolt heads on the extruder as shown.\r\n\r\nThe assembly can slide a little on the bolt heads. I recommend pushing the assembly down gently until it contacts the sides the bolt heads.\r\n\r\nProceed with the bed leveling measurements.\r\n\r\nBefore moving the extruder in the X or Y direction, I recommend that the Z stage be lowered enough so that the indicator is not touching the print bed. Use a round number (10 mm) when lowering and later raising the Z stage','2013-12-21 20:56:06','2013-12-21 20:56:06',0),(17,NULL,39,71,'Cute!\r\n','2014-02-08 18:21:30','2014-02-08 18:21:30',0),(18,NULL,63,52,'c','2014-02-26 12:30:32','2014-02-26 12:30:32',1),(19,NULL,64,16,'rtd','2014-02-26 12:52:31','2014-02-26 12:52:31',1),(20,NULL,64,83,'baa','2014-02-26 12:53:22','2014-02-26 12:53:22',1),(21,NULL,64,86,'aaa','2014-02-26 12:55:41','2014-02-26 12:55:41',1),(22,NULL,64,86,'aaa','2014-02-26 12:56:43','2014-02-26 12:56:43',1),(23,NULL,64,86,'aaa','2014-02-26 12:57:32','2014-02-26 12:57:32',1),(24,NULL,64,86,'aaa','2014-02-26 12:59:00','2014-02-26 12:59:00',1),(25,NULL,64,86,'aaa','2014-02-26 13:03:39','2014-02-26 13:03:39',1),(26,NULL,63,51,'sdddd','2014-02-26 13:04:57','2014-02-26 13:04:57',1),(27,NULL,64,86,'asfg','2014-02-26 13:06:56','2014-02-26 13:06:56',1),(28,NULL,38,100,'CyberNY this is just what I need to clean up my desk. I think this will be my next print. Love the interesting shapes.','2014-02-26 16:58:07','2014-02-26 16:58:07',0),(29,NULL,111,104,'nifty over 50','2014-02-26 17:39:21','2014-02-26 17:39:21',0),(30,NULL,111,105,'Christian','2014-02-26 17:54:06','2014-02-26 17:54:06',0),(31,NULL,179,86,'This wont work with rigid plastic. You cant remove the ice from the tray.','2014-02-26 22:29:10','2