INSERT INTO `doodles` VALUES (1,'Solidoodle Spool Mount Rev A','Solidoodle spool mount that fits on the back of your Solidoodle 2 and 3.','2013-07-10 11:37:05','2014-02-27 06:06:26',394,18,'61','2','2','140.png',1,0),(2,'Paperclip','Standard round paperclip 1.44 inches long. ','2013-07-10 12:08:12','2014-04-02 09:16:41',333,24,'61','2','5','141.png',1,0),(3,'Paperclip','Standard 1.44 inch round paperclip.','2013-07-10 12:11:53','2013-07-10 12:11:53',10,2,'61','2',NULL,NULL,0,1),(4,'Paperclip','Standard 1.44 inch round paperclip.','2013-07-10 12:12:02','2013-07-10 12:12:02',11,0,'61','2',NULL,NULL,0,1),(5,'Paperclip','Standard 1.44 inch paperclip.','2013-07-10 12:12:23','2013-07-10 12:12:23',9,0,'61','2',NULL,NULL,0,1),(6,'Spork','This spork is inspired by the Chinese Soup Spoon for printer-friendly results. No supports are needed. Be sure to use .9 infill density with a strong fill pattern like Archimedeanchords for a sturdy spoon handle. You\'ll want a feedrate of 75. The print should take approximately two and a half hours, unless you change the settings. Remember to use PLA plastic, rather than ABS for safe use. Enjoy!','2013-07-10 12:12:24','2013-07-12 12:07:43',30,0,'61','2','0','145.png',1,0),(7,'Dragon Curve- 6 iterations','A short and sweet print of the dragon curve with 6 iterations. The dragon curve is a fractal curve that is self-similar. Print multiple copies and add them together to grow your own dragon! The dragon curve also tiles well and in multiple positions. Put two dragons together back to back for a twindragon!','2013-07-10 12:21:50','2013-07-10 12:24:04',353,7,'61','2','5','146.png',1,0),(8,'Chinese Soup Spoon','The traditional Chinese Soup Spoon was originally made from porcelain, and is now commonly found mass produced in plastic. Using a feedrate of 75 and a .9 infill density with an Archimedeanchord fill pattern, you can print your own Chinese Soup Spoon. The print should take approximately two and a half hours. Remember to use PLA plastic for safe use! ','2013-07-10 12:41:14','2013-07-12 12:09:03',5,0,'61','2','7','147.png',0,1),(9,'Solidoodle Keychain','Never lose your keys again with the Solidoodle Keychain! Just print the file using the default 0.3 mm settings and attach it to your keychain ring. This print has a lot of gaps, so make sure your plate is perfectly level before printing','2013-07-10 12:43:27','2013-09-16 14:06:50',197,8,'61','2','5','148.png',0,0),(10,'Spork','This spork is inspired by the Chinese Soup Spoon for printer-friendly results. No supports are needed. Be sure to use the default .3mm settings with a honeycomb infill and a speedrate of 75. The print should take approximately two and a half hours, unless you change the settings. Remember to use PLA plastic, rather than ABS for safe use. Enjoy!','2013-07-10 13:04:42','2013-07-10 13:04:42',17,0,'61','2',NULL,NULL,0,1),(11,'July 4th Keychain','A festive keychain that reads \"Happy 4th of July!\" and is approximately 5 inches long. Just print the file using the default 0.3 mm settings and attach it to your keychain ring. This print has a lot of gaps, so make sure that the object is centered and your plate is perfectly level before printing. ','2013-07-10 13:07:21','2013-07-10 13:09:29',169,2,'61','2','5','150.png',0,0),(12,'Solid Female Pendant','Victorian inspired, this pendant features a female silhouette. Using default .3mm settings, you\'ll have beautiful pendant in just 15 minutes. The model has a whole on the top to be used for chord or string so you can where this pendant around your neck. This pendant can be a perfect gift for a loved one or be special something for yourself. Feel free to print as many as you like! You can also find a matching Solid Male Pendant on Solidoodles.com uploaded by Laurie3d.','2013-07-10 13:10:09','2013-07-10 13:10:09',171,1,'61','2','3',NULL,0,0),(13,'July 4th Keychain','A festive keychain that reads \"Happy 4th of July!\" and is approximately 5 inches long. Just print the file using the default 0.3 mm settings and attach it to your keychain ring. This print has a lot of gaps, so make sure that the object is centered and your plate is perfectly level before printing.','2013-07-10 13:11:50','2013-07-10 13:11:50',9,0,'61','2',NULL,NULL,0,1),(14,'abc','abc','2013-07-10 13:23:45','2013-07-10 13:23:45',26,1,'61','2',NULL,NULL,0,1),(15,'Clothespin','A clothespin to hang your clothes to dry. Print the object on its flat side with default 0.3 mm settings. ','2013-07-11 13:11:50','2013-07-11 13:12:18',98,1,'61','2','7','154.png',0,0),(16,'Number Die','Now you can use your own printed die in games with numbers instead of dots! Print the default 1 inch size or scale it up for a greater effect. Print with default 0.3 mm settings. ','2013-07-11 13:18:21','2014-02-27 06:03:21',405,37,'61','2','1','155.png',0,0),(17,'Dino Flipcoin Heads Part 1','Flip for heads or tails with this Dinosaur coin! Heads shows a T-rex head, and Tails shows a T-rex tail. Print the Heads file with the flat side face down on the platform. When both coin parts are printed, snap the Heads part within the Tails part to make one coin. Parts should fit securely together without falling apart when dropped. Use default 0.3 mm settings. ','2013-07-11 13:27:21','2013-07-11 13:27:40',233,3,'61','2','1','156.png',0,0),(18,'Dino Flipcoin Tails Part 2','Flip for heads or tails with this Dinosaur coin! Heads shows a T-rex head, and Tails shows a T-rex tail. Print the Tails file with the rim side face down on the platform and the tail pointing up. When both coin parts are printed, snap the Heads part within the Tails part to make one coin. Parts should fit securely together without falling apart when dropped. Use default 0.3 mm settings. ','2013-07-11 13:29:16','2013-07-11 13:30:10',198,3,'61','2','1','157.png',0,0),(19,'Poker chip','Casino standard sized poker chip, 39 mm in diameter, and approximately 3.15 mm in width. Print in different filament colors to indicate different chip values. Chip colors and values vary from venue to venue. Print with default 0.3 mm settings. ','2013-07-11 13:39:12','2013-07-11 13:39:30',137,10,'61','2','3','158.png',0,0),(20,'Two Tablespoon Measuring Scoop','Add a new measurement to your kitchen with the two tablespoon measuring scoop. Fill it to the top for exactly two tablespoons or fill it to the half line for one tablespoon. Print the scoop with the top down on the platform. May have to snip off excess filament hanging on the inside of the scoop. Make sure to print with food safe PLA filament and with default 0.3 mm settings. ','2013-07-11 13:46:38','2014-02-27 01:52:45',105,4,'61','2','7','159.png',0,0),(21,'Chain Bracelet','Link together the open chains to make your own customizable chain link bracelet. Each STL file holds nine chain links. Print this file twice to make the complete bracelet. A full chain bracelet requires about 16 chain links. Scale the file for more customizable bracelet options. Print with default 0.3 mm settings. ','2013-07-11 13:56:54','2013-07-11 13:57:26',76,0,'61','2','3','160.png',0,1),(22,'Flat paperclip','Standard paperclip 1.44 inches long that is flat.  ','2013-07-11 14:00:43','2013-07-11 14:00:43',29,0,'61','2','5',NULL,0,1),(23,'Flat paperclip','Standard paperclip 1.44 inches long that is flat.  ','2013-07-11 14:00:54','2013-07-11 14:01:19',229,22,'61','2','5','162.png',0,0),(24,'Bust','This bust can be used as a display stand for necklaces. Print with default 0.3 mm settings. ','2013-07-12 09:54:47','2014-02-27 07:29:24',165,4,'61','2','7','Bust.jpg',0,0),(25,'Double Dovetail Earrings or Friendship Necklaces','These two pieces, each measuring 1.5cm square, fit together to form the illusion known as the double dovetail puzzle. When put together, it appears as if there are two dovetails crossing each other to hold the two pieces together- making it appear as if it\'s impossible to take apart!\r\n\r\nThese two pieces would work well as a set of friendship necklaces, or as a set of earrings. The illusion looks even better when the two parts are printed in two different colors!','2013-07-12 09:57:55','2013-07-12 09:58:53',84,0,'61','2','7','164.png',0,0),(26,'Solid Male Pendant','Here is the mate to the Victorian inspired, \"Solid Female Pendant.\" Print using default .3mm settings. ','2013-07-12 10:03:18','2013-07-12 10:04:12',104,5,'61','2','3','165.png',0,0),(27,NULL,NULL,'2013-07-12 10:18:32','2013-07-12 10:18:32',3,0,'61','2',NULL,NULL,0,1),(28,NULL,NULL,'2013-07-12 10:28:47','2013-07-12 10:28:47',3,0,'61','2',NULL,NULL,0,1),(29,NULL,NULL,'2013-07-12 12:27:59','2013-07-12 12:27:59',3,0,'61','2',NULL,NULL,0,1),(30,NULL,NULL,'2013-07-12 13:48:11','2013-07-12 13:48:11',2,0,'61','2',NULL,NULL,0,1),(31,'1','1','2013-07-14 13:54:10','2013-07-14 13:57:53',5,0,'61','2','3',NULL,0,1),(32,'1','1','2013-07-14 14:01:15','2013-07-14 14:01:15',125,1,'61','2','3',NULL,0,0),(33,'Flower Pencil Container','Keep your pens and pencils together in this lovely flower pencil container. Use .3mm default settings and you\'ll have your pencil container in under five hours. ','2013-07-15 09:16:46','2013-07-30 15:00:31',213,12,'61','2','5','172.png',0,0),(34,'Rubber Band Gun Part One','This is part one of a nine part rubber band gun shaped in the form of a colt revolver. When printing make sure that the part is centered and check that the flat inside of the gun is face down on the platform. Print with default 0.3 mm settings. ','2013-07-15 09:44:41','2013-07-31 10:41:13',164,5,'61','2','3','173.png',0,0),(35,'Rubber Band Gun (Eleven Part Assembly)','This is an eleven part rubber band gun that assembles into the form of a colt revolver. Download and unzip the file to print each component. When printing, make sure that the each part is centered and print with default 0.3 mm settings. When all parts are printed, place the barrel (part 2) into the left hand side of the gun (part 1). Then press the two long dowels (part 3) into the left handle of the gun. Press the last long dowel into the second hole from the top of the left hand side. Press the rest of the dowels (part 4) in the resulting holes. Then insert the spinning piece (part 5) and the trigger (part 6) onto the dowels. After, attach the the right hand side of the gun (part 7) over all of the connections. The gun should now be snapped in place with the dowels sticking out from both sides. Now just attach the left and right cylinder parts (part 8 and 9) as well as the left and right handle parts (part 10 and 11). To fire the gun, attach a rubber band from the notch above the barrel to the cylinder. Press and release the trigger to rotate the cylinder. The rubber band should fire within two to three pulls of the trigger. ','2013-07-15 10:19:53','2013-08-14 14:37:43',196,13,'61','2','3','174.png',0,0),(36,'Dominos (Two parts)','A double six set of 28 dominos. Unzip the file and print 15dominospart1 to get the first half of dominos. Make sure that all of the dominos fit within the plate. Then print 13dominospart2 to print the second half. Each half takes approximately two and a half hours to print with 0.3 mm default settings. The zipped file also includes additional files of each domino so that they can be printed or arranged separately. ','2013-07-16 10:06:17','2013-07-16 10:06:30',217,1,'61','2','1','175.png',0,0),(37,'Dominos (Two parts)','A double six set of 28 dominos. Unzip the file and print 15dominospart1 to get the first half of dominos. Make sure that all of the dominos fit within the plate. Then print 13dominospart2 to print the second half. Each half takes approximately two and a half hours to print with 0.3 mm default settings. The zipped file also includes additional files of each domino so that they can be printed or arranged separately. ','2013-07-16 11:59:03','2013-07-16 11:59:28',244,2,'61','2','1','176.png',0,0),(38,'American Flag (Three Parts)','Show your colors with this American flag! This print comes as three separate files so it can be printed in the three different colors. The flagRed, flagWhite, and flagBlue should be printed in red, white, and blue respectively. To print, unzip the file and make sure each flag part is centered on the platform. Print one at a time with Solidoodle\'s default settings with 0.3 mm layer height,  3 perimeters, and 0.2 infill density. To change settings go to slicer, configure, and the print settings tab. The blue part is particularly tricky, since it has a lot of holes. It is important to make sure the platform is adjusted correctly and the first layer prints well before continuing.\r\n\r\nTo assemble, place the red layer down with the rectangular field in the top left corner. The white layer goes next, with the rectangular fields lining up, and the four attached white stripes fitting into the gaps extending to the right between the red stripes. The remaining two white stripes should fit into the two remaining slots below. Finally, the blue layer fits on top of the white rectangle. You can pick which side you prefer facing up! The white should shine through the star-shaped holes in the blue field. Glue together with glue if desired, and your American flag is now ready for display!','2013-07-17 08:56:27','2013-07-17 08:56:34',116,2,'61','2','3','177.png',0,0),(39,'Open Female Pendant','Print this beautiful pendant featuring a Victorian inspired female silhouette with a decorative frame. All you need is cord and you\'ll have a lovely necklace for yourself or a loved one. Want a matching pendant? See Open Male Pendant.','2013-07-19 07:35:39','2014-08-14 11:05:18',92,3,'61','2','3','guy-girl-pendants.jpg',0,0),(40,'Open Male Pendant','Using default .3mm settings, print yourself this lovely pendant featuring a male silhouette and decorative frame. For matching female version, see Open Female Pendant','2013-07-19 07:39:35','2014-08-14 11:02:38',84,2,'61','2','3','guy-girl-pendants.jpg',0,0),(41,'Outlet Safety Cover','Use these plastic covers to plug up unused outlets to keep your kids safe. Print with default 0.3 mm settings. ','2013-07-23 01:53:30','2013-07-23 01:54:45',2,0,'61','2','7',NULL,0,1),(42,'Outlet Safety Cover','Use these plastic covers to plug up unused outlets to keep your kids safe. Print with default 0.3 mm settings. ','2013-07-23 01:55:36','2013-07-23 01:55:36',15,0,'61','2','7',NULL,0,1),(43,'Outlet Safety Cover','Use these plastic covers to plug up unused outlets to keep your kids safe. Print with default 0.3 mm settings. Slowing down the feed rate is recommended for the prongs to ensure structure strength and shape.','2013-07-23 08:07:02','2013-07-23 08:09:24',117,4,'61','2','7','182.png',0,0),(44,'AIM-120 AMRAAM Model Rocket','No Description','2013-07-31 07:25:12','2014-03-24 18:31:05',276,14,'61','2','5','183.png',0,0),(45,'15 Puzzle with customizable tiles','A 15 puzzle is a four-by-four square with 15 sliding tiles. The goal is to slide them into the right order. Traditionally, the tiles are the numbers 1 through 15, but included in this zip file (in the tiles folder) are more letters so that you can customize your puzzle and even write out your own message!\r\n\r\nTiles include the numbers 0-9, letters A-Z (both upper and lower case), an exclamation point, a question mark, a dollar sign, an ampersand, a star, a heart, and a blank tile.','2013-08-01 08:32:24','2014-08-14 10:58:32',47,2,'61','2','0','puzle_(1).jpg',0,0),(46,'Dudeney Dissection','A hinged example of Henry Dudeney\'s dissection of an equilateral triangle into four pieces such that the pieces can be used to form a square. To assemble, print all four pieces, then lay them with the numbers facing the same direction. Piece number one is the lower left hand corner of the triangle, two is the top point, three is the right point, and four fills in the remaining gap to form a triangle. Rotate all the pieces on their hinges to create a square!','2013-08-01 08:45:31','2014-04-23 08:55:21',308,6,'61','2','2','185.png',0,0),(47,'Anti-Backlash Nut Holder','A simple, quick print to make sure the spring and nut installed for anti-backlash purposes stays tight. The hole in the middle goes over the nut, with the hexagonal inset facing down, and the legs go around the posts on either side to prevent the nut from turning.','2013-08-01 09:04:47','2014-02-27 06:06:08',281,5,'61','2','6','186.png',0,0),(48,NULL,NULL,'2013-08-13 12:29:28','2013-08-13 12:29:28',8,0,'61','2',NULL,NULL,0,1),(49,'Sanguinololu <--> Solidoodle Motherboard Adapter','This part will allow you to interchange between both the Sanguinololu and Solidoodle Motherbaord. You will need 3 extra M3 bolts and 3 M3 nuts to use this mount properly.','2013-08-20 14:15:29','2013-08-20 14:16:11',177,3,'37','2','6','188.png',0,0),(50,'Chopstick','Simple chopstick. Be sure to print in PLA if you intend to eat with it. For best results, print it laying horizontally on the print bed.','2013-08-22 14:34:13','2013-08-22 14:34:34',98,3,'61','2','3','189.png',0,0),(51,'Shot Glass','Simple shot glass. Be sure to print in PLA if you plan to use it.','2013-09-03 13:50:11','2013-09-03 13:50:41',138,10,'61','2','3','190.png',0,0),(52,'Cowboy Boot Cookie Cutter','Cowboy Boot Cookie Cutter. Make some cookies and send them to me!','2013-09-13 12:33:19','2014-08-14 09:31:25',161,2,'61','2','7','boot.jpg',0,0),(53,'Singer Sewing Machine Cookie Cutter','Singer Sewing Machine Cookie Cutter.','2013-09-13 12:34:54','2013-09-13 12:35:16',100,3,'61','2','7','192.png',0,0),(54,'Sloth Cookie Cutter','Sloth Cookie CUtter.','2013-09-13 12:36:08','2014-08-14 09:30:46',122,2,'61','2','7','cookie-cutter.jpg',0,0),(55,'Snail Cookie Cutter','Snail Cookie Cutter.','2013-09-13 12:37:41','2013-09-13 12:38:03',111,2,'61','2','7','194.png',0,0),(56,'Turkey','This is a turkey that we made for Thanksgiving','2013-09-20 09:12:00','2013-09-20 12:03:37',19,0,'38','2','3','195.png',0,1),(57,'New Bus for London','This is a model of the New Bus for London that we created and presented to Prince Harry and the David Cameron at the Great Tech Awards in New Y