name, your own shape, or anything! It prints in one piece, then when you take this print off your printer, middle will spin inside the circle! Merry Christmas!','2013-12-20 12:29:15','2013-12-20 12:29:27',97,0,'61','2','7','215.png',0,0),(77,'Magnetically attached dial indicator bracket','This is a magnetically attached measuring indicator bracket used for precise bed leveling on all Solidoodle 3D Printers.\r\n\r\nI am new at uploading things to Solidoodles. There are two parts to this item, so if you see only one part look for look for the other in a later post. The file names are: indicator_bkt_131217a.stl and indicator_bkt_131217a_holder.stl. \r\n\r\nThe part that holds the electronic dial indicator is separate from the bracket so that you can design your own part for holding a different dial indicator.\r\n\r\nThe magnets are very powerful 8 mm rare earth magnets available from Harbor Freight tools for $2.99 for a pack of 10 magnets.\r\n\r\nhttp://www.harborfreight.com/10-piece-rare-earth-magnets-67488.html\r\n\r\nThe electronic dial indicator used for this design is a \"Fowler X-Tread Tire Tread Thickness Gage\" that reads either mm or inches. It is available for Global Industrial for $15.75.\r\n\r\nhttp://www.globalindustrial.com/p/tools/test-measurement/gauges-dial-bore-gauge-sets/fowler-x-tread-tire-tread-thickness-gage?utm_source=google_pr&utm_medium=cpc&utm_campaign=Dimensional-Measuring-google_pr&infoParam.campaignId=T9F&gclid=CLGO7rj2jbMCFcNM4Aod5RcAkg','2013-12-21 20:54:24','2013-12-21 20:54:49',260,6,'39','2','6','216.png',0,0),(78,'Part 2 of Magnetic dial indicator bracket','See magnetically attached dial indicator bracket for the other part and instructions.','2013-12-21 21:00:56','2013-12-21 21:01:27',181,2,'39','2','6','217.png',0,0),(79,'Farkle marker','This is a marker for the fun and simple game of Farkle (by PatchProducts.com).\r\n\r\nDuring the game if the player does not score enough points, that person has \"Farkled\". We get to further tease the player by having them hold onto this marker until someone else Farkles. :)','2014-02-08 18:14:43','2014-02-08 18:25:06',135,1,'39','2','7','p140208_farkle.JPG',0,0),(80,'Trophy Cup 5','A nice thing to give someone who does well.\r\n\r\nThe picture shows the trophy cup printed at half the size of the .stl file provided\r\n','2014-02-09 12:42:52','2014-02-09 12:48:04',6,1,'39','2','2',NULL,0,1),(81,'Trophy Cup 5','A small trophy cup for someone who does well','2014-02-10 13:30:39','2014-09-17 01:25:50',313,28,'39','2','2','p140209_trophy_cup_5_crop.jpg',0,0),(82,'Solidoodle Carabiner','This is a one-piece carabiner. The thin walls of the gate create a nice springy action to keep the gate closed. Of course, it isn\'t strong enough for rock climbing, but it is great for clipping small things together. After printing it out, gently bend the gate into position. The ones I\'ve printed have held up to over 1000 opening/closing cycles.','2014-02-20 12:40:41','2014-02-27 11:39:09',2742,140,'38','2','7','221.png',0,0),(83,'Sheep','Bahhhhhh','2014-02-24 13:12:28','2014-08-14 10:51:44',7572,179,'61','2','7','sheep.jpg',0,0),(84,'Alleywire Logo','Logo created for Alleywire','2014-02-25 14:20:21','2014-02-25 14:23:09',82,2,'61','2','6','223.png',0,1),(85,'Mini Solidoodle','A small miniature Solidoodle 3D printer.','2014-02-25 14:25:28','2014-02-25 14:29:14',181,7,'61','2','6','224.png',0,0),(86,'Ice Tray #5','Some funky ice cube fun.','2014-02-25 18:29:41','2014-02-26 22:27:55',335,3,'61','2','3','225.png',0,0),(87,'Shark Ice Tray','Shark fin ice cubes!','2014-02-25 18:37:18','2014-02-27 10:56:40',202,4,'61','2','7','226.png',0,0),(88,'Chameleon','Chameleon climbing up, up, up!','2014-02-25 21:07:46','2014-02-25 21:10:32',5,0,'61','2','7','227.png',0,1),(89,'Solipoodle','The \"infamous\" but not really unofficial Solipoodle.','2014-02-25 21:13:41','2014-02-25 21:15:59',4,0,'61','2','7','228.png',0,1),(90,'Lizard','Lizard Sculpture','2014-02-26 09:13:19','2014-08-14 09:21:20',