nting. designed to fit on a solidoodle2 printbed. this and the left side need to be joined to make up the whole piece. The example print in the photos was printed on a solidoodle2 at .2mm resolution and barely cleaned up before acetone smoothing.','2014-03-02 01:00:42','2014-03-03 23:41:23',266,6,'317','2','4','294.png',0,0),(157,'screw mount camera for Gopro','Y\'ll find a part to fit gopro on screw mount camera','2014-03-02 11:54:22','2014-03-03 06:16:29',240,2,'321','2','6','295.png',0,0),(158,'20mm raiser for DJI Phantom + battery holder','I wanted to install a gimbal on my Phantom. So I design a 20mm raise and un battery holder. \r\nAnother advantage is to rebalance the quadricopter.','2014-03-02 12:02:56','2014-03-03 06:13:55',171,0,'321','2','6','296.png',0,0),(159,'HotSwap HDD adapter','for use with hot-swap computer bays.\r\n\r\nfound a few over on thingiverse... not quite right for my application. place the hdd up to high to plugin... so i had to sit down and learn how to use FreeCAD. \r\n\r\nso this is my first solidoodle ever made... \r\nfreshly made too... haven\'t had a chance to print and test. so I\'ll update when i do.\r\n\r\n3/5/14\r\ni have recently printed it. and found a few issues with it. \r\nmainly the screw holes were off and the retention spring catches - preventing it from ejecting. \r\ni have resolved these issues. (I hope, need to print once more)\r\n\r\nso... apparently you can\'t just replace the files after you have uploaded them... you have to delete and re-upload? this seems like a huge oversight... \r\n\r\nI have, however just added a new one labeled as: HotSwap HDD adapter 2.0 \r\nso i guess go to my doodles and check that one out?\r\n\r\nThank you,\r\n-Onus ','2014-03-02 17:11:33','2014-03-05 14:04:30',87,2,'163','2','6','hddadaptor.jpg',0,1),(160,'Graphic LCD stand','this is something i came up with to support my LCD screen on my i3','2014-03-05 07:45:16','2014-03-06 08:23:30',132,1,'348','2','6','298.png',0,0),(161,'Calibration