page that was pretty.\r\nthe floor began to glow softly, and bubbles with strange translucent colors appeared around his feet.The bubble finally come together, and the form of a giant snake suddenly sprang.\r\n\r\nit was an ancient dragon snake from the forgotten tales... the flat head of the monster slowly turned toward the apprentice magician and his hissed voice in his head : \' What can i do for you, young mistress ? and what will be my dinner ? \'\r\n\r\nhis red eyes stared at the young woman who did not know what to do ...\r\n\r\n---------------------------------------------------------------------------\r\n\r\nadvices :it\'s an easy print (despite being a big print)Â­. No support is needed to print it.\r\n3 perimeters , 10% infill, 0.2mm layer height  (tested with a 0.4mm nozzle, 1.75mm ABS filament))\r\nthe figurine size is : X-98.3mm Y-102mm Z-148.5mm \r\nI strongly suggest to push the scale to the size of Z=170mm if your printer build volume can supported it for an easiest print (and more of beautiful details) .\r\nThe slicing was tested in Cura, Kisslicer and slic3r.\r\nthe geometry is watertight','2014-03-21 16:44:13','2014-03-21 16:44:13',4,0,'53','2','7',NULL,0,1),(210,NULL,NULL,'2014-03-21 17:19:18','2014-03-21 17:19:18',1,0,'53','2',NULL,NULL,0,1),(211,NULL,NULL,'2014-03-21 17:37:17','2014-03-21 17:37:17',1,0,'53','2',NULL,NULL,0,1),(212,NULL,NULL,'2014-03-21 17:38:40','2014-03-21 17:38:40',1,0,'53','2',NULL,NULL,0,1),(213,NULL,NULL,'2014-03-21 17:39:52','2014-03-21 17:39:52',1,0,'53','2',NULL,NULL,0,1),(214,'The Summoner','She was the daughter of Ymoud tygard , a unknow wizard that lived in Tar valon, a big city near the Spine of the World.\r\nOne day that her father was out for working, and that she was alone in their shop of \'curiosity\', she began to look into the books of spells of his father.\r\none thing after another, and just for fun, she began to read a magic formula on a page that was pretty.\r\nthe floor began to glow softly, and bubbles with strange translucent colors appeared around her feet.The bubble finally come together, and the form of a giant snake suddenly sprang.\r\n\r\nit was an ancient dragon snake from the forgotten tales... the flat head of the monster slowly turned toward the apprentice magician and his hissed voice in his head : \' What can i do for you, young mistress ? and what will be my dinner ? \'\r\n\r\nhis red eyes stared at the young woman who did not know what to do ...\r\n\r\n\r\n---------------------------------------------------------------------------\r\n\r\n\r\nadvices :it\'s an easy print (despite being a big print)Â­. No support is needed to print it.\r\n3 perimeters , 10% infill, 0.2mm layer height  (tested with a 0.4mm nozzle, 1.75mm ABS filament))\r\nthe figurine size is : X-98.3mm Y-102mm Z-148.5mm \r\nI strongly suggest to push the scale to the size of Z=170mm if your printer build volume can supported it for an easiest print (and more of beautiful details) .\r\nThe slicing was tested in Cura, Kisslicer and slic3r.\r\nthe geometry is watertight\r\n\r\nPS : The quality of geometry was greatly reduced because Solidoodles can\'t accept the weight of my original model. I will upload a HD version when the problem will be corrected','2014-03-21 17:43:52','2014-03-31 10:39:42',870,30,'53','2','7','353.png',0,0),(215,NULL,NULL,'2014-03-21 18:49:08','2014-03-21 18:49:08',3,0,'401','2',NULL,NULL,0,1),(216,'Ted the Dragon','Ted was born as a snake, but wanted to be a dragon. Every day he would go to the gym, flexing relentlessly and telling himself it was all worth it. The other reptiles laughed at him, pointing out that no amount of muscle growth would impact his morphological disposition, and every day he did his best to ignore them. He worked and he worked, until one day, he happened to glance at himself in the mirror - and to his shock, he realized he\'d done it!\r\n\r\nToo bad he skipped leg day.','2014-03-21 18:51:09','2014-03-28 07:57:24',169,1,'401','2','7','355.pn