al...\r\n\r\nThe attached .stl has all SVM\'s parts in a single file as required by Solidoodles.com.    SVM was designed to be printable on any 3D printer in PLA or ABS with no support.  Simply arrange as many of the parts as your print bed allows and then print the remainder in a 2nd pass if needed!  \r\n\r\nI also have the Sketchup source file if interested.','2014-03-30 14:10:38','2014-04-14 13:45:36',120,5,'146','2','7','390.png',0,0),(254,'Skull Crawler','It\'s a pen holding \"Skull Crawler\" when on it\'s legs but viewed from the top or turned on its rear (back forward) its a happy snow man; spin it around and you have an angry Tiki statue (or so I\'ve been told)...\r\n\r\nThis model can be printed easily on any 3D printer with no support.  Print the Skull Crawler on his back with legs up in the air; and then sit him on your desk and skewer him with you favorite pens!\r\n','2014-03-30 14:25:33','2014-04-08 14:24:12',132,1,'146','2','7','391.png',0,0),(255,NULL,NULL,'2014-03-31 10:20:32','2014-03-31 10:20:32',2,0,'445','2',NULL,NULL,0,1),(256,NULL,NULL,'2014-03-31 10:24:11','2014-03-31 10:24:11',0,0,'445','2',NULL,NULL,0,1),(257,NULL,NULL,'2014-03-31 10:39:34','2014-03-31 10:39:34',0,0,'445','2',NULL,NULL,0,1),(258,'Tabbz - A mutant energy drink tab!!!!!!','You probably know about the tab on sodas and energy drinks right?  Well I enjoy flicking those off.  Well, one day I flicked one off and right into the trash can.  No big deal.  Unfortunately it was a big deal.  This tab never made it to the dump.  No no.  It somehow escaped the trash can and evolved into something much bigger and stronger.  Years of consuming who knows what to one day reach my doorstep for revenge.  The doorbell rang and I went to see who it was.  Nothing, until I looked down.  There it was a tiny little creature.  It had the craziest look in its eyes.  I recognized what it was.  It was a tab from an energy drink, but it had arms and legs.  Eyes and a mouth.  I grabbed it and stared at it for a minute and realized it was whispering something.  I brought it closer to my ear.  \"Recycle\" it said in a very faint voice, and the flicked my on the nose.  Very deserving of one I guess.  From that moment forward, I did as the little mutant tab asked and recycled.  \r\n\r\nMaterial - 1.75 mm Florescent Yellow PLA\r\n0.3 Layer Height\r\n0.1 Infill Honeycomb\r\n2 Hour Print Time with normal speeds\r\nNo supports only rafts for the feet\r\nCan also me made in ABS with no issues\r\n\r\nDownload and always recycle when possible so something mutant doesn\'t come after you  ','2014-04-09 10:33:19','2014-04-09 10:41:53',109,0,'414','2','7','tabbz.png',0,0),(259,NULL,NULL,'2014-04-01 08:22:12','2014-04-01 08:22:12',7,0,'416','2',NULL,NULL,0,1),(260,'Olaf','Olaf the penguin was left out of the fun and games that his other penguin buddies were partaking in. This is causing him to sit and cradle back and forth on a ice cube in the form of a cute desk ornament ','2014-04-01 10:40:45','2014-04-03 06:43:41',39,0,'445','2','4','397.png',0,1),(261,'Doodz','The toughest guy in high school.  If you\'re going through a rough break-up though, he\'ll be there for you. Y','2014-04-01 21:36:55','2014-04-01 21:46:40',9,0,'450','2','7',NULL,0,1),(262,'HotHead','Made of lava, this kid can take any heat you can dish out!  Bad guys beware!','2014-04-01 22:07:22','2014-04-01 22:24:31',8,1,'450','2','7','HOTHEAD.png',0,1),(263,'HotHead','This kid can take any heat you can throw at him.  Bad guys beware!','2014-04-01 22:28:01','2014-04-08 14:22:40',113,1,'450','2','7','400.png',0,0),(264,'Doodz','This high school tough guy will break your skull, but if you\'re going through a rough break-up, he\'ll be there for you <3','2014-04-01 22:32:49','2014-04-08 14:25:44',291,6,'450','2','7','401.png',0,0),(265,NULL,NULL,'2014-04-01 22:37:32','2014-04-01 22:37:32',2,0,'450','2',NULL,NULL,0,1),(266,NULL,NULL,'2014-04-01 22:49:18','2014-04-01 22:49:18',9,0,'450','2',NULL,NULL,0,1),(267,'Syre the Dragon