,'2014-04-14 12:39:56',46,0,'465','2','7','466.png',0,0),(330,'Felkin','My character is named Felkin, sun scepter and ruler of the Sun kingdom, Annareth. He rules over the kingdom and can easily be in more than one place at once, because he can fly at literally the speed of light. His kingdom is the best kingdom out of all of the other kingdoms because he has super sun powers.\r\n(Dejay H.)','2014-04-11 12:42:39','2014-04-11 12:43:14',63,0,'465','2','7','467.png',0,0),(331,'Mayo','This is Mayo, an 8 year old little girl who like dresses with bows, lighting things on fire, and can transform into a hedgehog spontaneously. Unfortunately, she has not learned to control this ability as of yet, and transforms spontaneously without warning. Mayoâ€™s disposition is sweet and innocent, but sheâ€™s convinced she is going to be the next super villain, so donâ€™t let that fool you. One day, sheâ€™ll be taking over the world with an army of hedgehogs standing behind her. \r\n(Amanda H>)','2014-04-11 12:44:39','2014-04-11 12:45:17',53,0,'465','2','7','468.png',0,0),(332,'Blu','Blu is a alien from the planet mars that travels to other planets and fights crime. (Scott I.)','2014-04-11 12:46:50','2014-04-11 12:47:05',47,0,'465','2','7','469.png',0,0),(333,'George the 3D printer','George is a 3D printer. He loves making peopleâ€™s ideas come to life into tangible objects. All he needs to survive is to be plugged into the wall. He also loves to eat up plastic and melt it down. (Scott J)','2014-04-11 12:48:50','2014-04-11 13:02:04',38,0,'465','2','7','470.png',0,0),(334,'George is a 3D printer 2','George 2 is a 3D printer. He loves making peopleâ€™s ideas come to life into tangible objects. All he needs to survive is to be plugged into the wall. He also loves to eat up plastic and melt it down. Scott J.','2014-04-11 13:03:57','2014-04-11 13:04:30',283,6,'465','2','2','471.png',0,0),(335,'Maximus','His goal in life is not to get killed. He likes to fight. He doesnâ€™t like to lose in a 