\r\n\r\nThe deformed shape was solved in an older version of the ANSYS Ed structural analysis program and converted to a .stl file. This was a large displacement plastic buckling analysis using quarter symmetry, later expanded to the full shape.\r\n\r\n301 stainless steel\r\ndiameter = 3 inch\r\nlength = 4.5 inch\r\nthickness = 0.1 inch\r\n','2014-05-30 19:17:02','2014-05-30 19:21:11',270,12,'39','2','2','p140530_buckled_pipe.JPG',0,0),(367,'Shelf Support','Just a small shelf support I made to hold a shelf in my medicine cabinet. ','2014-05-30 20:15:49','2014-05-30 20:15:49',156,5,'504','2','3','507.png',0,0),(368,'Skirt/Brim clip','Clip to hold brim and skirt down when thy start to lift from the platten due to warping.','2014-05-30 23:27:08','2014-05-30 23:27:08',4,0,'505','2','6',NULL,0,1),(369,'skirt clip','CLip to hold work to platten when the skirt/brim starts to lift.  Pause printing, clip it on, and continue.','2014-05-31 04:01:25','2014-05-31 04:01:25',2,0,'505','2','6',NULL,0,1),(370,'Brim Clip','Save that warping/lifting project.  Pause and clip the brim to the platten to help hold it down until completion.','2014-05-31 08:51:33','2014-06-02 08:02:05',113,0,'505','2','6','clamps.jpg',0,1),(371,'Shelf Support V2','A reinforced shelf support. Can hold more weight that previous version','2014-05-31 09:02:42','2014-05-31 09:02:42',138,4,'504','2','3','511.png',0,0),(372,'Olympic Torch Game','A friend, Tom Kemp, designed this as a game for a kid\'s function. (He authorized me to post his design for public, non-commercial use according to the license shown).\r\n\r\nThe idea is to have the kids race while trying to keep the ball in the pocket on the top of the torch. Share your ideas for other games :)\r\n\r\nThe total assembled length is about 470 mm = 18.5 inches\r\n\r\nThe tallest part (stg3) is about 165.5 mm = 6.5 inches\r\n\r\nInstructions:\r\n\r\nPrint stages 1, 2 and 3 and glue together with acetone.\r\n\r\nFor extra strength, I painted it all over with acetone to better hold the layers together. Acrylic work well for decoration.\r\n\r\nPrinting the ball will require the use of support material.\r\n\r\nThe ball can be attached to the torch by strong thread so that it does not get lost. \r\nI drilled out the small printed hole in the ball to make it easier to pass the thread through the ball.\r\n\r\nEnjoy.\r\n','2014-05-31 19:50:37','2014-05-31 19:59:05',171,0,'39','2','7','p140531_olympic_torch.JPG',0,0),(373,'Small spool adapter','For solidoodle 2 and 3 pvc elbows, snug fit adapter for small filament spools, like filaflex, and T-Glase...','2014-06-03 07:43:41','2014-06-03 07:43:41',1,0,'249','2','4',NULL,0,1),(374,'Small spool adapter','For solidoodle 2 and 3 pvc elbows, snug fit adapter for small filament spools, like filaflex, and T-Glase... Heavy infill, like 80% for a strong part!! Print up on large end with support, the inner support may remain inside.\r\n','2014-06-03 07:51:58','2014-06-03 08:33:44',365,9,'249','2','6','supportflex.jpg',0,0),(375,'Photo Booth Props','No party is complete without photo props.\r\n\r\nYou will also need 1/4\" dowel rods to complete the look.','2014-06-06 12:15:17','2014-06-06 12:43:09',1423,21,'61','2','7','20140606_141658.jpg',0,0),(376,'Minecraft Ore','Could be iron, diamond, redstone, or coal.  I think I actually used the diamond ore texture to model it.','2014-06-09 14:59:25','2014-06-09 15:02:49',150,8,'115','2','7','525.png',0,0),(377,'Minecraft Redstone Lamp','After I made the Minecraft Ore block, I thought I\'d try a different block.  Decided to finish it off with some fencing for it to stand on (maybe also to hide some wire leading to an LED).','2014-06-09 15:17:50','2014-06-09 15:17:50',186,3,'115','2','7','526.png',0,0),(378,'Minecraft Creeper','For some reason, I remember not being able to find a creeper, so I decided to make one of my own.','2014-06-09 15:28:18','2014-06-09 15:28:18',165,3,'115','2','7','528.png',0,0),(379,'Minecraft Pig','I still like making Minecr