ttps://play.google.com/store/apps/details?id=com.thinkerthing.drfluffsrobotfactoryfree','2014-11-25 22:12:15','2014-11-25 22:14:28',61,0,'765','2','7','678.png',0,0),(476,'Car 1','operational printable car ','2014-11-14 02:07:49','2014-11-14 02:07:49',93,2,'743','2','7','669.png',0,0),(477,'Gino','Dump truck steering wheel','2014-11-14 05:04:53','2014-11-14 05:04:53',118,0,'111','2','7','670.png',0,0),(478,'Gino','1ST Xmas orn','2014-11-14 05:12:45','2014-11-14 05:12:45',109,0,'111','2','3',NULL,0,0),(479,'Gino 1st','1st Xmas','2014-11-14 05:16:34','2014-11-14 05:16:34',117,1,'111','2','3',NULL,0,0),(480,'gino','1st xmas','2014-11-14 05:29:58','2014-11-14 05:29:58',160,0,'111','2','3',NULL,0,0),(481,'ball mount for a small mirror','This is a ball mount for a small mirror which allows rotation about any axis. The mirror rim is 52.5 mm diameter by 4.88 mm thick.\r\n\r\nGlue (with acetone) the ball_141114b.stl to mirror_mount_141113b.stl. Glue clip_141114g.stl to mount_141115.stl. snap the ball into clip_141114g.stl. Use double stick foam tape to attach to top of monitro. \r\n\r\nSome of the design concepts: \r\nThe ball diameter is 20 mm.\r\nThe 3 arms have 20 mm ball diameter indents. However the arms have been moved inward 0.5 mm to provide a slight preload on the ball to keep in place.\r\n\r\nThe preload will be sensitive to the arm length and inward movement of the three arms in clip_141114g.stl. A higher preload will hold the mirror in place more tightly. Shorter arms increase the ball preload because they will be stiffer (proportional to L^3). Moving the arm radially inward more also increases the preload. The limit to these two effects is that the arms will break when inserting the ball.\r\n\r\nIf you use the design concept for other applications, please share with the community.','2014-11-16 16:43:30','2014-11-16 16:56:16',216,0,'39','2','3','p141116a_mirror_mount.JPG',0,0),(483,'Robot Ready','This robot was created using a mobile app, Dr Fluffs Robot Factory.